import React from "react";
import styled from "styled-components";

const LoadingView = styled("div")`
display: block;
position: fixed; 
z-index: 1;
width: 100%;
height: 100%;
overflow: auto;
background-color: rgba(0,0,0,1);
position:absolute;
`;

const LoadingContent = styled("div")`
    background-color: #fefefe;
    padding: 15px;
    width:400px;
    position:absolute;
    display: block;
    left:50%;
    top:50%;
    -ms-transform: translate(-50%, -50%);
    transform: translate(-50%, -50%);
    border-radius:5px;
`;



const Loading = () => {


    return (
        <>
            <LoadingView>
                <LoadingContent >
                    <h1>Loading</h1>
                </LoadingContent>
            </LoadingView>
        </>
    );
};

export default Loading;
